import React from 'react'
import  "./StoryReel.css"
import Story from "./Story"

function StoryReel() {
    return (
        <div className="storyReel">
            <Story
                image="data:image/jpeg;base64,"
                profileSrc="data:image/jpeg;base64,"
                title="Pop Tweet 1"
            />

            <Story
                image="data:image/jpeg;base64,"
                profileSrc="data:image/jpeg;base64,"
                title="Pop Tweet 2"
            />

            <Story
                                image="data:image/jpeg;base64,"
                profileSrc="data:image/jpeg;base64,"
                title="Pop Tweet 3"
            />

            <Story
                                image="data:image/jpeg;base64,"
                profileSrc="data:image/jpeg;base64,"
                title="Pop Tweet 4"
            />
        </div>
    )
}

export default StoryReel
